First we solve 3*d + d + 18 - 59 = i + 21 for d.  Subtracting 21 from both sides gives 3*d + d + 18 - 59 = i, and adding 59 to both sides gives 3*d + d + 18 = i + 59.  Combining like terms, we get 4*d + 18 = i + 59.  Subtracting 18 from both sides gives 4*d = i + 41, and dividing both sides by 4 gives d = i/4 + 17/4.

Substituting this into 83*i - 4*d = 102, we get 83*i - 4*(i/4 + 17/4) = 102.  This simplifies to 83*i - i - 17 = 102, which simplifies to 82*i - 17 = 102.  Adding 17 to both sides gives 82*i = 120, which dividing by 82 gives i = 120/82 = 10/7.

