\end{align*} Adding the original equation 0 = -h - 4*q + 6, we get  \begin{align*}
0 &= 276h - 96q - 144 + (-h - 4q + 6) \\
&= 275h - 96q - 140.
\end{align*} If we multiply this equation by 10, we get  \begin{align*}
0 &= 2750h - 960q - 1400.
\end{align*} Adding the equation 0 = 30*h - 18, we get  \begin{align*}
0 &= 2750h - 960q - 1400 + (30h - 18) \\
&= 2780h - 960q - 1382.
\end{align*} If we multiply this equation by 10, we get  \begin{align*}
