Subtracting the first equation from the second gives

\begin{align*}
-v + 2*t + 15 &= -24\\
\Rightarrow v - 2*t &= -19.
\end{align*}

Substituting v = -19 - 2t into the equation -v + 2*t = -19 gives

\begin{align*}
-(-19 - 2t) + 2t &= -19\\
\Rightarrow 19 + 4t &= -19\\
\Rightarrow 4t &= -38\\
\Rightarrow t &= -9.
\end{align*}

Substituting t = -9 into v - 2*t = -19 gives

\begin{align*}
v - 2*(-9) &= -19\\
\Rightarrow v + 18 &= -19\\
\Rightarrow v &= -37.
\end{align*}

Substituting v = -37 into -v*a = -4*a + 13 gives

\begin{align*}
-(-37)*a &= -4*a + 13\\
\Rightarrow 37*a &= 4*a - 13\\
\Rightarrow 33*a &= -13\\
\Rightarrow a &= -4.
\end{align*}

